const rooms = [{
  id: 'room1',
  name: 'ROOM1',
  description: 'Some room description',
  image: avatars.find(a => a.id === 'room-1').image
}, {
  id: 'room2',
  name: 'ROOM2',
  description: 'Another room description',
  image: avatars.find(a => a.id === 'room-2').image
}];

const toUser = (socket) => {
  return {
    id: socket.id,
    name: socket.name,
    image: socket.image,
    peerId: socket.peerId
  }
}

const getRoster = (roomId) => {
  const clients = io.sockets.adapter.rooms.get(roomId);
  return clients ? Array.from(clients).map(c => toUser(io.sockets.sockets.get(c))) : [];
}

const joinRoom = (socket, room) => {
  const roomId = room.id;
  socket.join(roomId);
  socket.emit('room', room);
  io.in(roomId).emit('room:roster', {
    roomId,
    roster: getRoster(roomId)
  })
  socket.to(roomId).emit('room:user:connect', {
    roomId,
    ...toUser(socket)
  });
}

const leaveRoom = (socket, room) => {
  const roomId = room.id;
  socket.leave(roomId);
  socket.to(roomId).emit('room:user:disconnect', {
    roomId,
    ...toUser(socket)
  });
  io.in(roomId).emit('room:roster', {
    roomId,
    roster: getRoster(roomId)
  })
}

const isJoined = (socket, roomId) => {
  const room = io.sockets.adapter.rooms.get(roomId);
  return room && room.has(socket.id);
}

io.on('connection', socket => {
  socket.emit('connected', true);
  socket.emit('authorization', false);

  socket.on('login', (name, password, callback) => {
    const found = users.find(u => u.email === name && u.password === password);
    if (found) {
      socket.name = found.name;
      socket.image = found.image
      const user = toUser(socket);
      callback && callback(user);
      socket.emit('authorization', true);
      socket.emit('user', user);
      socket.emit('rooms', rooms);
    } else {
      callback && callback();
      socket.emit('authorization', false);
    }
  })

  socket.on('logout', (callback) => {
    socket.name = undefined;
    socket.image = undefined;
    socket.peerId = undefined;
    callback && callback();
    socket.emit('authorization', false);
  });

  socket.on('peer', (peerId, callback) => {
    socket.peerId = peerId;
    const user = toUser(socket);
    callback && callback(user);
    socket.emit('user', user);
  });

  socket.on('user', (callback) => {
    const user = toUser(socket)
    callback && callback(user);
    socket.emit('user', user);
  });

  socket.on('room:disconnect', (roomId, callback) => {
    callback && callback();
    isJoined(socket, roomId) && leaveRoom(socket, roomId);
  });

  socket.on('room:connect', (roomId, callback) => {
    const room = rooms.find(r => r.id === roomId);
    if (room) {
      joinRoom(socket, room);
      socket.once('disconnect', () => {
        leaveRoom(socket, room);
      });
    }
    callback && callback(room);
  });

  socket.on('room:message', (roomId, from, message, callback) => {
    isJoined(socket, roomId) && io.in(roomId).emit('room:message', {
      roomId,
      from,
      message
    });
    callback && callback();
  });

  socket.on('room:call', (roomId, callback) => {
    isJoined(socket, roomId) && io.in(roomId).emit('room:call');
    callback && callback();
  });

  socket.on('room:call:connect', (roomId, user, callback) => {
    isJoined(socket, roomId) && socket.to(roomId).emit('room:call:connect', {
      roomId,
      ...user
    });
    callback && callback();
  });

  socket.on('room:call:disconnect', (roomId, user, callback) => {
    isJoined(socket, roomId) && socket.to(roomId).emit('room:call:disconnect', {
      roomId,
      ...user
    });
    callback && callback();
  });
});



